import { createStore } from 'vuex'

export default createStore({
  state: {
    data:"eee"
  },
  getters: {
  },
  mutations: {
    sendTodo(state,params) {
      state.data = params
    }
  },
  actions: {
    increment({ commit }) {

      commit('sendTodo')

    }
  },
  modules: {
  }
})
